import React, { Component } from 'react';

import './css/menuContent.css';

class MenuContent extends Component {
    //constructor(props) {
    // super(props)
    // this.items = []
    // }

    render() {
        return (
            <div className="menu-holder">
            <ul id="menu-header_menu_first" className="menu"><li id="menu-item-1198" className="mobile menu-item menu-item-type-post_type menu-item-object-page menu-item-1198"><a href="https://radio.eol.co.il/schedule/" className="menu-image-title-after"><span className="menu-image-title">לוח שידורים</span></a></li>
              <li id="menu-item-18" className="menu-item menu-item-type-custom menu-item-object-custom menu-item-18"><a href="http://radio.eol.co.il/allseries" className="menu-image-title-after"><span className="menu-image-title">תכניות</span></a></li>
              <li id="menu-item-19" className="menu-item menu-item-type-custom menu-item-object-custom menu-item-19"><a href="http://radio.eol.co.il/allbroadcasters" className="menu-image-title-after"><span className="menu-image-title">שדרנים</span></a></li>
              <li id="menu-item-181" className="menu-item menu-item-type-post_type menu-item-object-page menu-item-181"><a href="https://radio.eol.co.il/mahutv/" className="menu-image-title-after"><span className="menu-image-title">מהות<span className="en">TV</span></span></a></li>
              <li id="menu-item-21" className="menu-item menu-item-type-custom menu-item-object-custom menu-item-21"><a href="http://radio.eol.co.il/podcasts/" className="menu-image-title-after"><span className="menu-image-title">ערוץ הפודקאסטים</span></a></li>
            </ul><ul id="menu-header_menu_second" className="menu"><li id="menu-item-179" className="menu-item menu-item-type-post_type menu-item-object-page menu-item-179"><a href="https://radio.eol.co.il/about/" className="menu-image-title-after"><span className="menu-image-title">אודות</span></a></li>
              <li id="menu-item-191" className="menu-item menu-item-type-post_type menu-item-object-page menu-item-191"><a href="https://radio.eol.co.il/contactus/" className="menu-image-title-after"><span className="menu-image-title">צור קשר</span></a></li>
              <li id="menu-item-180" className="menu-item menu-item-type-post_type menu-item-object-page menu-item-180"><a href="https://radio.eol.co.il/signup/" className="menu-image-title-after"><span className="menu-image-title">הרשמו לניוזלטר</span></a></li>
            </ul><ul id="menu-header_menu_third" className="menu"><li id="menu-item-349" className="menu-img menu-item menu-item-type-custom menu-item-object-custom menu-item-349"><a target="_blank" href="http://www.mahuti.co.il/" className="menu-image-title-hide menu-image-not-hovered"><span className="menu-image-title">&nbsp;מהותי</span><img width={1} height={1} src="https://radio.eol.co.il/wp-content/uploads/2018/05/logo-menu-2.svg" className="menu-image menu-image-title-hide" alt="" /></a></li>
              <li id="menu-item-350" className="menu-img-2 menu-item menu-item-type-custom menu-item-object-custom menu-item-350"><a href="http://www.eol.co.il/" className="menu-image-title-hide menu-image-not-hovered"><span className="menu-image-title">מהות חיים</span><img width={1} height={1} src="https://radio.eol.co.il/wp-content/uploads/2018/05/logo-menu-1.svg" className="menu-image menu-image-title-hide" alt="" /></a></li>
            </ul>	        <div className="social-links">
              <a href="https://soundcloud.com/search?q=EOL%20radio" aria-label="ערוץ הסאונדקלאוד של רדיו מהות החיים">
                <picture>
                  <source srcSet="https://radio.eol.co.il/wp-content/uploads/2018/03/soundcloud-01.svg" media="(min-width: 640px)" />
                  <img src alt="" className="social-link-item-1"/>
                </picture>
              </a>
              <a href="https://www.facebook.com/radio.eol.co.il/" aria-label="עמוד הפייסבוק של רדיו מהות החיים">
                <picture>
                  <source srcSet="https://radio.eol.co.il/wp-content/uploads/2018/03/face-01.svg" media="(min-width: 640px)" />
                  <img src alt="" className="social-link-item-2"/>
                </picture>
              </a>
              <a href="https://www.youtube.com/user/MahutHahaim" aria-label="ערוץ היוטיוב של רדיו מהות החיים">
                <picture>
                  <source srcSet="https://radio.eol.co.il/wp-content/uploads/2018/03/youtube-01.svg" media="(min-width: 640px)" />
                  <img src alt="" className="social-link-item-3"/>
                </picture>
              </a>
            </div>
          </div>
          
        )
    }
}

// MenuContent.PropTypes = {
